# Definition for a binary tree node.# class TreeNode:#     def __init__(self, x):#         self.val = x#         self.left = None#         self.right = Noneclass Solution:    def leafSimilar(self, root1, root2):        """        :type root1: TreeNode        :type root2: TreeNode        :rtype: bool        """        self.root_leaf=[]        def helper(root):            if root.left==None and root.right==None:                self.root_leaf.append(root.val)                return            if root.left:                helper(root.left)            if root.right:                helper(root.right)        helper(root1)        temp=self.root_leaf.copy()        self.root_leaf.clear()        helper(root2)        if self.root_leaf==temp:            return True        else:            return False